INSERT INTO news VALUES ('3', 'Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò', '<p style=\"text-align:justify\">Nước lũ nhấn ch&igrave;m nhiều trường học ở H&agrave; Tĩnh, sau khi nước r&uacute;t, gi&aacute;o vi&ecirc;n, lực lượng c&ocirc;ng an v&agrave; bộ đội đ&atilde; tập trung dọn dẹp để chuẩn bị đ&oacute;n học sinh tới lớp.</p>\r\n', '1', 'upload/img/news/anh1.jpg', '<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-1603351694754440778481.jpg\" target=\"_blank\" title=\"Sáng 22/10, sau khi nước rút, tại trường Mầm non Thạch Tân (xã Tân Lâm Hương, huyện Thạch Hà, tỉnh Hà Tĩnh) nhiều giáo viên đã đến trường để bắt đầu dọn dẹp với phương châm nước rút đến đâu dọn đến đó\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 1.\" id=\"img_27a08f10-1438-11eb-ba90-1b374f66522a\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-1603351694754440778481.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 1.\" /></a></p>\r\n\r\n<p>S&aacute;ng 22/10, sau khi nước r&uacute;t, tại trường Mầm non Thạch T&acirc;n (x&atilde; T&acirc;n L&acirc;m Hương, huyện Thạch H&agrave;, tỉnh H&agrave; Tĩnh) nhiều gi&aacute;o vi&ecirc;n đ&atilde; đến trường để bắt đầu dọn dẹp với phương ch&acirc;m nước r&uacute;t đến đ&acirc;u dọn đến đ&oacute;</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-16033517289161356440090.jpg\" target=\"_blank\" title=\"Tại trường Mầm non Thạch Tân hiện tại nước lũ vẫn còn ngập sâu, cao trên nửa mét từ ngoài sân, còn bên trong lớp học nước đang lấp xấp. Dù đang ngập sâu nhưng nhiều giáo viên vẫn lội nước cao trên nửa mét để vào lớp mò tìm sách, rửa để phơi cho học sinh\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 2.\" id=\"img_3c2c4370-1438-11eb-b503-cd93b12f0281\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-16033517289161356440090.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 2.\" /></a></p>\r\n\r\n<p>Tại trường Mầm non Thạch T&acirc;n hiện tại nước lũ vẫn c&ograve;n ngập s&acirc;u, cao tr&ecirc;n nửa m&eacute;t từ ngo&agrave;i s&acirc;n, c&ograve;n b&ecirc;n trong lớp học nước đang lấp xấp. D&ugrave; đang ngập s&acirc;u nhưng nhiều gi&aacute;o vi&ecirc;n vẫn lội nước cao tr&ecirc;n nửa m&eacute;t để v&agrave;o lớp m&ograve; t&igrave;m s&aacute;ch, rửa để phơi cho học sinh</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-16033517412411377713145.jpg\" target=\"_blank\" title=\"Cô Hoàng Thị Nga (giáo viên trường Mầm non Thạch Tân) nghẹn ngào khi nhìn sách, đồ dùng học tập của học sinh bị lũ nhấn chìm. “Nước hôm nay đã rút, nhưng tại trường vẫn còn cao trên nửa mét. Riêng trong lớp nước còn lấp xấp nhưng sách vở của các cháu, tài liệu giáo viên đã bị ướt nhiều. Sáng nay đến dọn, mò tìm sách, đồ dùng cho các cháu mà xót xa. Nhìn cảnh này không biết khi nào các cháu mới trở lại trường được”, cô Nga nói\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 3.\" id=\"img_435b40b0-1438-11eb-b264-1d3aa0359b29\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-16033517412411377713145.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 3.\" /></a></p>\r\n\r\n<p>C&ocirc; Ho&agrave;ng Thị Nga (gi&aacute;o vi&ecirc;n trường Mầm non Thạch T&acirc;n) nghẹn ng&agrave;o khi nh&igrave;n s&aacute;ch, đồ d&ugrave;ng học tập của học sinh bị lũ nhấn ch&igrave;m. &ldquo;Nước h&ocirc;m nay đ&atilde; r&uacute;t, nhưng tại trường vẫn c&ograve;n cao tr&ecirc;n nửa m&eacute;t. Ri&ecirc;ng trong lớp nước c&ograve;n lấp xấp nhưng s&aacute;ch vở của c&aacute;c ch&aacute;u, t&agrave;i liệu gi&aacute;o vi&ecirc;n đ&atilde; bị ướt nhiều. S&aacute;ng nay đến dọn, m&ograve; t&igrave;m s&aacute;ch, đồ d&ugrave;ng cho c&aacute;c ch&aacute;u m&agrave; x&oacute;t xa. Nh&igrave;n cảnh n&agrave;y kh&ocirc;ng biết khi n&agrave;o c&aacute;c ch&aacute;u mới trở lại trường được&rdquo;, c&ocirc; Nga n&oacute;i</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-1603351754217266057730.jpg\" target=\"_blank\" title=\"Nhiều sách vở, đồ dùng học tập tại trường bị nước ngập sâu làm ướt\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 4.\" id=\"img_4b692c40-1438-11eb-9361-41b70f733b55\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-1603351754217266057730.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 4.\" /></a></p>\r\n\r\n<p>Nhiều s&aacute;ch vở, đồ d&ugrave;ng học tập tại trường bị nước ngập s&acirc;u l&agrave;m ướt</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-16033517638931073422788.jpg\" target=\"_blank\" title=\"Cô giáo vào lớp tìm sách, đồ dùng để phơi nắng\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 5.\" id=\"img_512ab6d0-1438-11eb-800f-fffacad656d9\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-16033517638931073422788.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 5.\" /></a></p>\r\n\r\n<p>C&ocirc; gi&aacute;o v&agrave;o lớp t&igrave;m s&aacute;ch, đồ d&ugrave;ng để phơi nắng</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-1603351773074979106884.jpg\" target=\"_blank\" title=\"Cô Nguyễn Thị Hòa - Hiệu trưởng trường Mầm non Thạch Tân (xã Tân Lâm Hương) cho hay, hiện tại các trường đang bị ngập sâu. Để học sinh trở lại trường phải đến cuối tuần sau mới có thể học lại bình thường. Hiện tại sách vở, đồ dùng học tập đã bị cuốn trôi nhiều. Ngoài ra bàn ghế cũng bị hư hỏng\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 6.\" id=\"img_56abdd00-1438-11eb-a8d6-1fb25422c890\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-1603351773074979106884.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 6.\" /></a></p>\r\n\r\n<p>C&ocirc; Nguyễn Thị H&ograve;a - Hiệu trưởng trường Mầm non Thạch T&acirc;n (x&atilde; T&acirc;n L&acirc;m Hương) cho hay, hiện tại c&aacute;c trường đang bị ngập s&acirc;u. Để học sinh trở lại trường phải đến cuối tuần sau mới c&oacute; thể học lại b&igrave;nh thường. Hiện tại s&aacute;ch vở, đồ d&ugrave;ng học tập đ&atilde; bị cuốn tr&ocirc;i nhiều. Ngo&agrave;i ra b&agrave;n ghế cũng bị hư hỏng</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-1603351784404823009949.jpg\" target=\"_blank\" title=\"Còn tại trường Tiểu học Thạch Tân (xã Tân Lâm Hương) lực lượng công an, bộ đội và giáo viên đang có mặt để dọn dẹp để học sinh trở lại sau lũ\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 7.\" id=\"img_5e2a80e0-1438-11eb-929b-a13ddfe58f9c\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-1603351784404823009949.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 7.\" /></a></p>\r\n\r\n<p>C&ograve;n tại trường Tiểu học Thạch T&acirc;n (x&atilde; T&acirc;n L&acirc;m Hương) lực lượng c&ocirc;ng an, bộ đội v&agrave; gi&aacute;o vi&ecirc;n đang c&oacute; mặt để dọn dẹp để học sinh trở lại sau lũ</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-1603351795558981525201.jpg\" target=\"_blank\" title=\"Ông Trần Huy Hợi - Hiệu trưởng trường Tiểu học Thạch Tân cho hay, nước lũ ngập sâu, nhiều sách vở, đồ dùng của các em học sinh đã bị ướt sạch. Hiện tại lực lượng giáo viên, công an, bộ đội đang hỗ trợ thu dọn và đưa ra phơi xem có khắc phục được hay không. Trong ảnh cô giáo đang rửa lại bảng, dụng cụ học tập cho học sinh.\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 8.\" id=\"img_645617e0-1438-11eb-8e41-4bc6af865fc1\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-1603351795558981525201.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 8.\" /></a></p>\r\n\r\n<p>&Ocirc;ng Trần Huy Hợi - Hiệu trưởng trường Tiểu học Thạch T&acirc;n cho hay, nước lũ ngập s&acirc;u, nhiều s&aacute;ch vở, đồ d&ugrave;ng của c&aacute;c em học sinh đ&atilde; bị ướt sạch. Hiện tại lực lượng gi&aacute;o vi&ecirc;n, c&ocirc;ng an, bộ đội đang hỗ trợ thu dọn v&agrave; đưa ra phơi xem c&oacute; khắc phục được hay kh&ocirc;ng. Trong ảnh c&ocirc; gi&aacute;o đang rửa lại bảng, dụng cụ học tập cho học sinh.</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-1603351815476728935272.jpg\" target=\"_blank\" title=\"Sáng nay, các cán bộ giáo viên trường Tiểu học Thạch Tân đã tổ chức dọn dẹp bàn học\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 9.\" id=\"img_7077de00-1438-11eb-929b-a13ddfe58f9c\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-1603351815476728935272.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 9.\" /></a></p>\r\n\r\n<p>S&aacute;ng nay, c&aacute;c c&aacute;n bộ gi&aacute;o vi&ecirc;n trường Tiểu học Thạch T&acirc;n đ&atilde; tổ chức dọn dẹp b&agrave;n học</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-16033518191804482669.jpg\" target=\"_blank\" title=\"Tận dụng nắng phơi sách vở cho các em học sinh\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 10.\" id=\"img_7328cd30-1438-11eb-a8d6-1fb25422c890\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-16033518191804482669.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 10.\" /></a></p>\r\n\r\n<p>Tận dụng nắng phơi s&aacute;ch vở cho c&aacute;c em học sinh</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-16033518360511149244482.jpg\" target=\"_blank\" title=\"Lực lượng công an hỗ trợ phơi sách vở cho các em học sinh\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 11.\" id=\"img_7c7f3e50-1438-11eb-b4b1-873f29055c0e\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-16033518360511149244482.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 11.\" /></a></p>\r\n\r\n<p>Lực lượng c&ocirc;ng an hỗ trợ phơi s&aacute;ch vở cho c&aacute;c em học sinh</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-1603351848822736148835.jpg\" target=\"_blank\" title=\"Nữ giáo viên xót xa khi sách vở, đồ dùng của học sinh bị ướt sau lũ\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 12.\" id=\"img_841e6280-1438-11eb-879e-913dd5b26389\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-1603351848822736148835.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 12.\" /></a></p>\r\n\r\n<p>Nữ gi&aacute;o vi&ecirc;n x&oacute;t xa khi s&aacute;ch vở, đồ d&ugrave;ng của học sinh bị ướt sau lũ</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-1603351857769247400522.jpg\" target=\"_blank\" title=\"Nước lũ đã rút tại trường mầm non Cẩm Mỹ, huyện Cẩm Xuyên (nằm dưới hạ du, cách hồ Kẻ Gỗ khoảng 5km), hàng chục bộ đội, giáo viên được huy động dọn dẹp khuôn viên trường. Trước đó hai ngày, mưa lớn kéo dài kết hợp với hồ Kẻ Gỗ xả lũ khiến nước dâng cao 2m, các trang thiết bị, phòng hành chính, 8 phòng học, đồ chơi học sinh bị nước lũ nhấn chìm\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 13.\" id=\"img_8a0c0620-1438-11eb-90fe-8d764074f447\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-1603351857769247400522.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 13.\" /></a></p>\r\n\r\n<p>Nước lũ đ&atilde; r&uacute;t tại trường mầm non Cẩm Mỹ, huyện Cẩm Xuy&ecirc;n (nằm dưới hạ du, c&aacute;ch hồ Kẻ Gỗ khoảng 5km), h&agrave;ng chục bộ đội, gi&aacute;o vi&ecirc;n được huy động dọn dẹp khu&ocirc;n vi&ecirc;n trường. Trước đ&oacute; hai ng&agrave;y, mưa lớn k&eacute;o d&agrave;i kết hợp với hồ Kẻ Gỗ xả lũ khiến nước d&acirc;ng cao 2m, c&aacute;c trang thiết bị, ph&ograve;ng h&agrave;nh ch&iacute;nh, 8 ph&ograve;ng học, đồ chơi học sinh bị nước lũ nhấn ch&igrave;m</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-16033518676341852912451.jpg\" target=\"_blank\" title=\"Hàng chục chiến sĩ công an, bộ đội và giáo viên được huy động đến trường  Mầm non Cẩm Mỹ, huyện Cẩm Xuyên để dọn dẹp sau lũ đón học sinh trở lại trường học\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 14.\" id=\"img_8f187180-1438-11eb-b4b1-873f29055c0e\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-16033518676341852912451.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 14.\" /></a></p>\r\n\r\n<p>H&agrave;ng chục chiến sĩ c&ocirc;ng an, bộ đội v&agrave; gi&aacute;o vi&ecirc;n được huy động đến trường Mầm non Cẩm Mỹ, huyện Cẩm Xuy&ecirc;n để dọn dẹp sau lũ đ&oacute;n học sinh trở lại trường học</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-16033518806081743261471.jpg\" target=\"_blank\" title=\"Hiện tại có hơn 100.000 học sinh tại 270 trường học ở Hà Tĩnh đã đi học trở lại. Theo Sở GD&amp;ĐT Hà Tĩnh, có 250 trường từ bậc Mầm non đến THCS thuộc các huyện: Hương Sơn (62/62), Hương Khê (49/55), Vũ Quang (15/29), Can Lộc (20/52), Nghi Xuân 47/47, Đức Thọ 57/59 và khoảng 20 trường THPT\"><img alt=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 15.\" id=\"img_96ca8170-1438-11eb-a8d6-1fb25422c890\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-16033518806081743261471.jpg\" title=\"Lũ rút, giáo viên lội nước cao nửa mét vào trường mò tìm sách cho trò - Ảnh 15.\" /></a></p>\r\n\r\n<p>Hiện tại c&oacute; hơn 100.000 học sinh tại 270 trường học ở H&agrave; Tĩnh đ&atilde; đi học trở lại. Theo Sở GD&amp;ĐT H&agrave; Tĩnh, c&oacute; 250 trường từ bậc Mầm non đến THCS thuộc c&aacute;c huyện: Hương Sơn (62/62), Hương Kh&ecirc; (49/55), Vũ Quang (15/29), Can Lộc (20/52), Nghi Xu&acirc;n 47/47, Đức Thọ 57/59 v&agrave; khoảng 20 trường THPT</p>\r\n', 'lu-rut-giao-vien-loi-nuoc-cao-nua-met-vao-truong-mo-tim-sach-cho-tro', 'vi', null, null, '1603382800', '1', '0', '1', '', '', '', '', '2', '1', '1', '0');
INSERT INTO news VALUES ('4', 'Hoà Minzy phải tiêm 10 mũi thuốc sau nhiều ngày dầm mưa đi cứu trợ, xót xa vì vòng 3 rướm máu', '<p style=\"text-align:justify\">V&agrave;o h&ocirc;m qua 21/10,&nbsp;<a href=\"https://kenh14.vn/hoa-minzy.html\" target=\"_blank\" title=\"hoà minzy\">Ho&agrave; Minzy</a>&nbsp;th&ocirc;ng b&aacute;o đ&atilde; trở lại S&agrave;i G&ograve;n sau 2 ng&agrave;y trực tiếp đi v&agrave;o t&acirc;m lũ để cứu trợ b&agrave; con miền Trung.</p>\r\n', '1', 'upload/img/news/anh2.jpg', '<h2>Dầm mưa nhiều ng&agrave;y để đi cứu trợ người d&acirc;n miền Trung, Ho&agrave; Minzy bị cảm lạnh v&agrave; phải ti&ecirc;m 10 mũi thuốc sau khi trở về.</h2>\r\n\r\n<ul>\r\n	<li><a href=\"https://kenh14.vn/hoa-minzy-gap-su-co-tren-duong-ho-tro-san-phu-den-benh-vien-giua-vung-lu-dai-dien-len-tieng-noi-ro-thuc-hu-20201020194418288.chn\" title=\"Hoà Minzy gặp sự cố trên đường hỗ trợ sản phụ đến bệnh viện giữa vùng lũ, đại diện lên tiếng nói rõ thực hư\">Ho&agrave; Minzy gặp sự cố tr&ecirc;n đường hỗ trợ sản phụ đến bệnh viện giữa v&ugrave;ng lũ, đại diện l&ecirc;n tiếng n&oacute;i r&otilde; thực hư&nbsp;</a></li>\r\n	<li><a href=\"https://kenh14.vn/dan-sao-viet-dong-loat-co-mat-tai-mien-trung-vo-chong-luong-the-thanh-ly-hai-den-tung-vung-hoa-minzy-mang-hang-tram-phao-boi-20201019182513903.chn\" title=\"Nhiều nghệ sĩ Vbiz đồng lòng đến với miền Trung ruột thịt: Vợ chồng Lương Thế Thành, Lý Hải đến từng vùng, Hoà Minzy mang hàng trăm áo phao\">Nhiều nghệ sĩ Vbiz đồng l&ograve;ng đến với miền Trung ruột thịt: Vợ chồng Lương Thế Th&agrave;nh, L&yacute; Hải đến từng v&ugrave;ng, Ho&agrave; Minzy mang h&agrave;ng trăm &aacute;o phao&nbsp;</a></li>\r\n	<li><a href=\"https://kenh14.vn/em-trai-hoa-minzy-dien-ao-xanh-cuc-banh-khoe-visual-chanh-sa-tren-du-thuyen-ngay-mua-sao-trung-hop-ghe-20201016005218642.chn\" title=\"Em trai Hoà Minzy diện áo xanh cực bảnh, khoe visual “chanh sả” trên du thuyền ngày mưa: Sao trùng hợp ghê?\">Em trai Ho&agrave; Minzy diện &aacute;o xanh cực bảnh, khoe visual &ldquo;chanh sả&rdquo; tr&ecirc;n du thuyền ng&agrave;y mưa: Sao tr&ugrave;ng hợp gh&ecirc;?&nbsp;</a></li>\r\n</ul>\r\n\r\n<p>V&agrave;o h&ocirc;m qua 21/10,&nbsp;<a href=\"https://kenh14.vn/hoa-minzy.html\" target=\"_blank\" title=\"hoà minzy\">Ho&agrave; Minzy</a>&nbsp;th&ocirc;ng b&aacute;o đ&atilde; trở lại S&agrave;i G&ograve;n sau 2 ng&agrave;y trực tiếp đi v&agrave;o t&acirc;m lũ để cứu trợ b&agrave; con miền Trung. C&ocirc; cho biết m&igrave;nh quay trở về để giải quyết c&ocirc;ng việc, kiếm th&ecirc;m tiền rồi lại v&agrave;o với b&agrave; con. V&igrave; Ho&agrave; Minzy thức trắng 2 đ&ecirc;m, dầm mưa, lội nước n&ecirc;n kh&aacute;n giả v&ocirc; c&ugrave;ng lo lắng cho sức khoẻ của c&ocirc;.</p>\r\n\r\n<ul>\r\n	<li><a href=\"https://kenh14.vn/hoa-minzy-thuc-trang-2-dem-lien-de-cuu-tro-ba-con-kiet-suc-den-ngu-thiep-di-tai-san-bay-ve-sai-gon-20201021095732022.chn\" target=\"_blank\">Ho&agrave; Minzy thức trắng 2 đ&ecirc;m liền để cứu trợ b&agrave; con, kiệt sức đến ngủ thiếp đi tại s&acirc;n bay về S&agrave;i G&ograve;n</a></li>\r\n</ul>\r\n\r\n<p>Cho tới chiều nay (22/10), quản l&yacute; Ho&agrave; Minzy x&oacute;t xa chia sẻ đoạn tin nhắn với nữ ca sĩ, tiết lộ rằng c&ocirc; đ&atilde; phải ti&ecirc;m 10 mũi thuốc, v&ograve;ng 3 rướm m&aacute;u sau khi trở về.&nbsp;<em>&quot;Đợt rồi đi miền Trung ơn trời sao n&oacute; lại khoẻ đột xuất d&ugrave; trước đ&oacute; đ&atilde; ti&ecirc;m 5 mũi thuốc. Giờ về th&igrave; lao v&agrave;o mấy việc đ&atilde; lỡ k&iacute; sẵn thế l&agrave; kiệt sức do cảm lạnh v&agrave; giọng kh&agrave;n đặc đi. S&aacute;ng nay, trước khi đi l&agrave;m việc phải đi ti&ecirc;m th&ecirc;m 10 mũi thuốc v&agrave;o m&ocirc;ng rớm cả m&aacute;u thấy m&agrave; thương! L&agrave;m quản l&yacute; như m&igrave;nh cũng muốn n&oacute; nghỉ ngơi cho lại sức nhưng mấy việc đ&atilde; k&iacute; kh&ocirc;ng thể bỏ được! Thương g&aacute;i! Th&ocirc;i xong nốt rồi dưỡng sức trở lại c&ograve;n nhiều thứ lắm nh&eacute;!&quot;,&nbsp;</em>quản l&yacute; Ho&agrave; Minzy chia sẻ.</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo2020-10-22-172533-16033623463321735112470.jpeg\" target=\"_blank\" title=\"Hoà Minzy cảm lạnh, phải tiêm 10 mũi thuốc để có sức khoẻ làm việc tiếp sau 2 ngày xông pha vào tâm lũ cứu trợ người dân miền Trung\"><img alt=\"Hoà Minzy phải tiêm 10 mũi thuốc sau nhiều ngày dầm mưa đi cứu trợ, xót xa vì vòng 3 rướm máu - Ảnh 2.\" id=\"img_f30655f0-1450-11eb-a8d6-1fb25422c890\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo2020-10-22-172533-16033623463321735112470.jpeg\" title=\"Hoà Minzy phải tiêm 10 mũi thuốc sau nhiều ngày dầm mưa đi cứu trợ, xót xa vì vòng 3 rướm máu - Ảnh 2.\" /></a></p>\r\n\r\n<p>Ho&agrave; Minzy cảm lạnh, phải ti&ecirc;m 10 mũi thuốc để c&oacute; sức khoẻ l&agrave;m việc tiếp sau 2 ng&agrave;y x&ocirc;ng pha v&agrave;o t&acirc;m lũ cứu trợ người d&acirc;n miền Trung</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo2020-10-22-171555-16033617975341308576337.jpeg\" rel=\"lightbox\" title=\"\"><img alt=\"Hoà Minzy phải tiêm 10 mũi thuốc sau nhiều ngày dầm mưa đi cứu trợ, xót xa vì vòng 3 rướm máu - Ảnh 3.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/22/photo2020-10-22-171555-16033617975341308576337.jpeg\" title=\"Hoà Minzy phải tiêm 10 mũi thuốc sau nhiều ngày dầm mưa đi cứu trợ, xót xa vì vòng 3 rướm máu - Ảnh 3.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo2020-10-22-171602-16033617975381181930466.jpeg\" rel=\"lightbox\" title=\"\"><img alt=\"Hoà Minzy phải tiêm 10 mũi thuốc sau nhiều ngày dầm mưa đi cứu trợ, xót xa vì vòng 3 rướm máu - Ảnh 3.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/22/photo2020-10-22-171602-16033617975381181930466.jpeg\" title=\"Hoà Minzy phải tiêm 10 mũi thuốc sau nhiều ngày dầm mưa đi cứu trợ, xót xa vì vòng 3 rướm máu - Ảnh 3.\" /></a></p>\r\n\r\n<p>Đoạn tin nhắn của Ho&agrave; Minzy v&agrave; quản l&yacute; của m&igrave;nh, h&eacute; lộ h&igrave;nh ảnh v&ograve;ng 3 rướm m&aacute;u, khiến người h&acirc;m mộ v&ocirc; c&ugrave;ng x&oacute;t xa</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-1603361283080193112774.png\" target=\"_blank\" title=\"Hoà Minzy ngủ thiếp ở sân bay sau khi thức trắng 2 đêm để đi cứu trợ bà con vùng lũ\"><img alt=\"Hoà Minzy phải tiêm 10 mũi thuốc sau nhiều ngày dầm mưa đi cứu trợ, xót xa vì vòng 3 rướm máu - Ảnh 4.\" id=\"img_7a1ba9d0-144e-11eb-9bcb-01d5243ef6ce\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-1603361283080193112774.png\" title=\"Hoà Minzy phải tiêm 10 mũi thuốc sau nhiều ngày dầm mưa đi cứu trợ, xót xa vì vòng 3 rướm máu - Ảnh 4.\" /></a></p>\r\n\r\n<p>Ho&agrave; Minzy ngủ thiếp ở s&acirc;n bay sau khi thức trắng 2 đ&ecirc;m để đi cứu trợ b&agrave; con v&ugrave;ng lũ</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo-1-1603361284897522185090.jpg\" target=\"_blank\" title=\"Vào chiều 19/10, Hoà Minzy có mặt tại Hà Tĩnh để cứu trợ lương thực, áo phao cho người dân\"><img alt=\"Hoà Minzy phải tiêm 10 mũi thuốc sau nhiều ngày dầm mưa đi cứu trợ, xót xa vì vòng 3 rướm máu - Ảnh 5.\" id=\"img_7b1cc620-144e-11eb-9893-4917f02b553e\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo-1-1603361284897522185090.jpg\" title=\"Hoà Minzy phải tiêm 10 mũi thuốc sau nhiều ngày dầm mưa đi cứu trợ, xót xa vì vòng 3 rướm máu - Ảnh 5.\" /></a></p>\r\n\r\n<p>V&agrave;o chiều 19/10, Ho&agrave; Minzy c&oacute; mặt tại H&agrave; Tĩnh để cứu trợ lương thực, &aacute;o phao cho người d&acirc;n</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/photo2020-10-22-172621-16033623921081234406908.jpeg\" target=\"_blank\" title=\"Đến ngày 21/10, Hoà Minzy cho biết cô quay lại Sài Gòn để giải quyết công việc, kiếm tiền rồi lại vào với bà con\"><img alt=\"Hoà Minzy phải tiêm 10 mũi thuốc sau nhiều ngày dầm mưa đi cứu trợ, xót xa vì vòng 3 rướm máu - Ảnh 6.\" id=\"img_0e707690-1451-11eb-b503-cd93b12f0281\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/photo2020-10-22-172621-16033623921081234406908.jpeg\" title=\"Hoà Minzy phải tiêm 10 mũi thuốc sau nhiều ngày dầm mưa đi cứu trợ, xót xa vì vòng 3 rướm máu - Ảnh 6.\" /></a></p>\r\n\r\n<p>Đến ng&agrave;y 21/10, Ho&agrave; Minzy cho biết c&ocirc; quay lại S&agrave;i G&ograve;n để giải quyết c&ocirc;ng việc, kiếm tiền rồi lại v&agrave;o với b&agrave; con</p>\r\n', 'hoa-minzy-phai-tiem-10-mui-thuoc-sau-nhieu-ngay-dam-mua-di-cuu-tro-xot-xa-vi-vong-3-ruom-mau', 'vi', null, null, '1603382918', '1', '0', '1', '', '', '', '', null, '1', '1', '0');
INSERT INTO news VALUES ('5', 'Nữ nhà báo nói về việc quản lý 100 tỷ từ thiện của Thủy Tiên: \"Cô nên thành lập một team, bao gồm luật sư, truyền thông, kế toán... để hỗ trợ mình\"', '<p style=\"text-align:justify\"><span style=\"font-size:14px\">Ra đời từ nhiều thập kỷ trước, đầm x&ograve;e vẫn chưa bao giờ hạ nhiệt v&agrave; hứa hẹn sẽ c&ograve;n &ldquo;chinh phạt&rdquo; khắp c&aacute;c s&agrave;n diễn thời trang lớn. Sự duy&ecirc;n d&aacute;ng, mềm mại, tạo bước đi uyển chuyển nhẹ nh&agrave;ng, bay bổng dường như l&agrave; sức h&uacute;t &ldquo;chết người&rdquo; của đầm x&ograve;e v&agrave; đ&atilde; chiếm trọn tr&aacute;i tim của ph&aacute;i đẹp. Với kiểu d&aacute;ng đặc trưng, những kiểu đầm x&ograve;e đẹp c&oacute; khả năng che khuyết điểm tuyệt vời. C&aacute;c c&ocirc; n&agrave;ng &ldquo;c&ograve; hương&rdquo; với v&ograve;ng 2 v&agrave; v&ograve;ng 3 mỏng mảnh, đến c&aacute;c &ldquo;b&eacute; bự&rdquo; với v&ograve;ng eo v&agrave; v&ograve;ng 3 hơi qu&aacute; khổ đều thoải m&aacute;i, tự tin với d&aacute;ng đầm x&ograve;e &ldquo;dễ t&iacute;nh&rdquo; n&agrave;y.</span></p>\r\n', '1', 'upload/img/news/thuy-tien-5-16033713200321435242386.jpg', '<h2>Xung quanh c&acirc;u chuyện Thủy Ti&ecirc;n v&agrave; việc l&agrave;m từ thiện với số tiền l&ecirc;n đến hơn 100 tỷ đồng, nh&agrave; b&aacute;o Ho&agrave;ng Thu Hường đ&atilde; c&oacute; những chia sẻ thẳng thắn tr&ecirc;n trang c&aacute; nh&acirc;n. &quot;T&ocirc;i đoán m&ocirc;̣t người n&ocirc;̉i ti&ecirc;́ng như c&ocirc; đã có, lu&ocirc;n có team h&ocirc;̃ trợ, nhưng m&ocirc;̃i c&ocirc;ng vi&ecirc;̣c, m&ocirc;̃i lĩnh vực c&acirc;̀n chuy&ecirc;n gia ri&ecirc;ng&quot;, chị Hường viết.</h2>\r\n\r\n<ul>\r\n	<li><a href=\"https://kenh14.vn/nhung-con-so-biet-noi-qua-chuyen-cuu-tro-mien-trung-cua-thuy-tien-dang-sau-3-bai-viet-1-trieu-like-va-100-ty-la-cau-chuyen-long-tot-duoc-lan-toa-20201021223518006.chn\" title=\"Những con số biết nói qua chuyến cứu trợ miền Trung của Thủy Tiên: Đằng sau 3 bài viết 1 triệu like và 100 tỷ là câu chuyện lòng tốt được lan tỏa\">Những con số biết n&oacute;i qua chuyến cứu trợ miền Trung của Thủy Ti&ecirc;n: Đằng sau 3 b&agrave;i viết 1 triệu like v&agrave; 100 tỷ l&agrave; c&acirc;u chuyện l&ograve;ng tốt được lan tỏa&nbsp;</a></li>\r\n	<li><a href=\"https://kenh14.vn/dbqh-noi-ve-viec-thuy-tien-lam-tu-thien-quy-dinh-da-loi-thoi-can-ra-soat-sua-doi-20201021171708913.chn\" title=\"ĐBQH nói về việc Thủy Tiên làm từ thiện: Quy định đã lỗi thời, cần rà soát, sửa đổi\">ĐBQH n&oacute;i về việc Thủy Ti&ecirc;n l&agrave;m từ thiện: Quy định đ&atilde; lỗi thời, cần r&agrave; so&aacute;t, sửa đổi&nbsp;</a></li>\r\n	<li><a href=\"https://kenh14.vn/thuy-tien-va-tran-thanh-cong-khai-tong-so-tien-quyen-gop-can-moc-gan-70-ty-dong-tiep-tuc-hanh-trinh-cuu-tro-o-quang-binh-20201019092103642.chn\" title=\"Thủy Tiên và Trấn Thành công khai tổng số tiền quyên góp cán mốc gần 70 tỷ đồng, tiếp tục hành trình cứu trợ ở Quảng Bình\">Thủy Ti&ecirc;n v&agrave; Trấn Th&agrave;nh c&ocirc;ng khai tổng số tiền quy&ecirc;n g&oacute;p c&aacute;n mốc gần 70 tỷ đồng, tiếp tục h&agrave;nh tr&igrave;nh cứu trợ ở Quảng B&igrave;nh&nbsp;</a></li>\r\n</ul>\r\n\r\n<p>Những ng&agrave;y qua, người d&acirc;n miền Trung phải oằn m&igrave;nh chống lại b&atilde;o lũ lịch sử. H&agrave;ng vạn ng&ocirc;i nh&agrave; bị nhấn ch&igrave;m, t&agrave;i sản, hoa m&agrave;u, ruộng đồng cũng bị d&ograve;ng nước lũ cuốn tr&ocirc;i.</p>\r\n\r\n<p>Trước t&igrave;nh h&igrave;nh lũ lụt g&acirc;y ra những tổn thất nặng nề, rất nhiều c&aacute; nh&acirc;n, tổ chức đ&atilde; đứng ra quy&ecirc;n g&oacute;p, ủng hộ đồng b&agrave;o miền Trung. Trong số đ&oacute;, ca sĩ Thủy Ti&ecirc;n l&agrave; một trong những nghệ sĩ tạo ấn tượng mạnh với cộng đồng, khi chỉ trong 6 ng&agrave;y k&ecirc;u gọi, nữ ca sĩ đ&atilde; nhận được hơn 100 tỷ đồng tiền cứu trợ. Điều n&agrave;y c&oacute; thể thấy được sức ảnh hưởng v&agrave; sự tin tưởng gửi v&agrave;o Thủy Ti&ecirc;n lớn như thế n&agrave;o.</p>\r\n\r\n<p>Tuy nhi&ecirc;n, 100 tỷ đồng l&agrave; một con số qu&aacute; lớn v&agrave; l&agrave;m nảy ra những cuộc tranh luận về việc Thủy Ti&ecirc;n sẽ sử dụng số tiền n&agrave;y thế n&agrave;o. Xung quanh vấn đề n&agrave;y, nh&agrave; b&aacute;o Ho&agrave;ng Thu Hường đ&atilde; c&oacute; những chia sẻ thẳng thắn tr&ecirc;n trang c&aacute; nh&acirc;n như sau:</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/21/121636597101602689951924374606425080860054888o-160278269457380756375220201017105609-16032946802582087688519.jpg\" title=\"\"><img alt=\"Nữ nhà báo nói về việc quản lý 100 tỷ từ thiện của Thủy Tiên: Cô nên thành lập một team, bao gồm luật sư, truyền thông, kế toán... để hỗ trợ mình - Ảnh 1.\" id=\"img_687b5900-13b3-11eb-8e41-4bc6af865fc1\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/21/121636597101602689951924374606425080860054888o-160278269457380756375220201017105609-16032946802582087688519.jpg\" title=\"Nữ nhà báo nói về việc quản lý 100 tỷ từ thiện của Thủy Tiên: Cô nên thành lập một team, bao gồm luật sư, truyền thông, kế toán... để hỗ trợ mình - Ảnh 1.\" /></a></p>\r\n\r\n<p>&quot;Thủy Ti&ecirc;n đã làm quá t&ocirc;́t khi l&acirc;̣p tức x&ocirc;ng pha l&ecirc;n tuy&ecirc;́n đ&acirc;̀u. Chính sự d&acirc;́n th&acirc;n đó góp ph&acirc;̀n làm s&ocirc;́ ti&ecirc;̀n quy&ecirc;n góp l&ecirc;n cả trăm tỷ&quot;</p>\r\n\r\n<p>Trước h&ecirc;́t xin tuy&ecirc;n b&ocirc;́ m&igrave;nh ch&iacute;nh thức l&agrave; người h&acirc;m mộ của Thủy Ti&ecirc;n. Nhi&ecirc;̀u người đ&atilde; d&agrave;nh lời c&oacute; c&aacute;nh cho bạn &acirc;́y r&ocirc;̀i, nhưng m&igrave;nh v&acirc;̃n c&acirc;̀n n&oacute;i th&ecirc;m:</p>\r\n\r\n<p>Trong những ng&agrave;y vừa rồi, m&ocirc;̣t &quot;c&ocirc; Ti&ecirc;n&quot; mảnh dẻ, xắn qu&acirc;̀n lao v&agrave;o d&ograve;ng nước lũ, đ&ecirc;́n từng nh&agrave; xoa d&acirc;̀u cho người gi&agrave;, b&ecirc; từng th&ugrave;ng mỳ chai nước đ&ecirc;́n cho người d&acirc;n tạo ra sự x&uacute;c đ&ocirc;̣ng mạnh mẽ. Sẵn c&oacute; n&ecirc;̀n tảng n&ocirc;̉i ti&ecirc;́ng v&agrave; những hoạt đ&ocirc;̣ng thi&ecirc;̣n nguy&ecirc;̣n th&agrave;nh c&ocirc;ng trước đ&oacute;, Thủy Ti&ecirc;n l&acirc;̣p tức trở th&agrave;nh cục nam ch&acirc;m, thu h&uacute;t t&igrave;nh cảm, sự tin tưởng m&agrave; nhi&ecirc;̀u tri&ecirc;̣u người đang d&acirc;ng tr&agrave;n trong b&ocirc;́i cảnh đau thương của Mi&ecirc;̀n Trung đang di&ecirc;̃n ra d&ocirc;̀n d&acirc;̣p.</p>\r\n\r\n<p>Ở m&ocirc;̣t c&aacute;ch n&agrave;o đ&oacute;, Thủy Ti&ecirc;n đại di&ecirc;̣n cho l&ograve;ng trắc &acirc;̉n của h&agrave;ng tri&ecirc;̣u người, chuy&ecirc;n chở cảm x&uacute;c của cả c&ocirc;̣ng đ&ocirc;̀ng tới nạn nh&acirc;n. Con s&ocirc;́ trăm tỷ đ&atilde; n&oacute;i l&ecirc;n ngu&ocirc;̀n &quot;t&agrave;i nguy&ecirc;n thi&ecirc;̣n nguy&ecirc;̣n&quot; trong c&ocirc;̣ng đ&ocirc;̀ng r&acirc;́t lớn, rất dồi d&agrave;o v&agrave; h&agrave;o ph&oacute;ng. Vấn đề l&agrave; khai th&aacute;c, sử dụng v&agrave; bảo v&ecirc;̣ t&agrave;i nguy&ecirc;n &acirc;́y th&ecirc;́ n&agrave;o.</p>\r\n\r\n<p>C&oacute; thể coi c&ocirc; ca sĩ mang t&ecirc;n Thuỷ Ti&ecirc;n đang giữ gi&aacute; trị niềm tin. N&ecirc;́u gi&aacute; trị &acirc;́y sụp đ&ocirc;̉, th&igrave; nạn nh&acirc;n b&atilde;o lụt kh&ocirc;ng chỉ m&acirc;́t đi m&ocirc;̣t &quot;c&ocirc; Ti&ecirc;n&quot;, m&agrave; c&ocirc;̣ng đ&ocirc;̀ng lại m&ocirc;̣t l&acirc;̀n t&ocirc;̉n thương v&agrave; &quot;t&agrave;i nguy&ecirc;n thi&ecirc;̣n nguy&ecirc;̣n&quot; sẽ kh&ocirc;ng được bảo v&ecirc;̣ v&agrave; khai th&aacute;c hi&ecirc;̣u quả. Thi&ecirc;̣t hại cu&ocirc;́i c&ugrave;ng sẽ l&agrave; những người c&acirc;̀n được h&ocirc;̃ trợ như c&aacute;c nạn nh&acirc;n thi&ecirc;n tai v&agrave; những người y&ecirc;́u th&ecirc;́. V&agrave; t&ocirc;i viết b&agrave;i n&agrave;y với mong mu&ocirc;́n bảo v&ecirc;̣ th&acirc;̀n tượng Thủy Ti&ecirc;n, hay n&oacute;i ch&iacute;nh x&aacute;c hơn, l&agrave; bảo v&ecirc;̣ t&agrave;i nguy&ecirc;n thi&ecirc;̣n nguy&ecirc;̣n trong c&ocirc;̣ng đ&ocirc;̀ng.</p>\r\n\r\n<p><strong>1. Thủy Ti&ecirc;n đ&atilde; l&agrave;m qu&aacute; t&ocirc;́t khi l&acirc;̣p tức x&ocirc;ng pha l&ecirc;n tuy&ecirc;́n đ&acirc;̀u.</strong>&nbsp;Ch&iacute;nh sự d&acirc;́n th&acirc;n đ&oacute; g&oacute;p ph&acirc;̀n l&agrave;m s&ocirc;́ ti&ecirc;̀n quy&ecirc;n g&oacute;p l&ecirc;n cả trăm tỷ. Tuy nhi&ecirc;n giờ l&agrave; l&uacute;c c&ocirc; n&ecirc;n nghỉ. Nh&igrave;n qua những bức ảnh, th&acirc;́y khu&ocirc;n mặt c&ocirc; g&acirc;̀y r&ocirc;̣c, 2 mắt th&acirc;m qu&acirc;̀ng. Su&ocirc;́t cả tu&acirc;̀n lặn l&ocirc;̣i, ăn v&ocirc;̣i ngủ v&ocirc;̣i, dầm mưa dầm nước, đ&agrave;n &ocirc;ng c&ograve;n suy sụp chứ đừng n&oacute;i tới sức v&oacute;c mảnh mai kia.</p>\r\n\r\n<p>Chưa k&ecirc;̉ m&ocirc;̣t v&acirc;́n đ&ecirc;̀ kh&aacute;c l&agrave; &quot;ch&acirc;́n thương t&acirc;m l&yacute;&quot;. C&aacute;c nh&acirc;n vi&ecirc;n cứu h&ocirc;̣, qu&acirc;n nh&acirc;n, ph&oacute;ng vi&ecirc;n, nh&acirc;n vi&ecirc;n y t&ecirc;́... khi trực ti&ecirc;́p chứng ki&ecirc;́n những h&igrave;nh ảnh v&agrave; c&acirc;u chuy&ecirc;̣n tang thương sẽ bị t&aacute;c đ&ocirc;̣ng t&acirc;m l&yacute;, nhẹ th&igrave; m&acirc;́t ngủ căng thẳng, nặng th&igrave; cảm gi&aacute;c ti&ecirc;u cực nặng n&ecirc;̀ &aacute;m ảnh k&eacute;o d&agrave;i nhi&ecirc;̀u th&aacute;ng hay cả năm.</p>\r\n\r\n<p>T&ocirc;i nghĩ những c&aacute;i Ti&ecirc;n tận mắt nh&igrave;n thấy, nghe thấy những ng&agrave;y qua hẳn l&agrave; sẽ khiến c&ocirc; đau l&ograve;ng v&agrave; kiệt sức. Thuỷ Ti&ecirc;n đ&atilde; qua thời đi&ecirc;̉m x&ocirc;ng pha k&ecirc;u gọi, giờ đ&ecirc;́n giai đoạn g&aacute;nh tr&ecirc;n vai trọng tr&aacute;ch của người đ&atilde; được trao niềm tin. Nh&acirc;́t cử nh&acirc;́t đ&ocirc;̣ng đang được h&agrave;ng tri&ecirc;̣u người theo d&otilde;i. C&ocirc; n&ecirc;n nghỉ ngơi v&agrave; h&agrave;nh đ&ocirc;̣ng trong trạng th&aacute;i khỏe mạnh thoải m&aacute;i nh&acirc;́t, c&ocirc;̣ng đ&ocirc;̀ng sẽ được hưởng lợi t&ocirc;́t hơn.</p>\r\n\r\n<p><strong>2. L&uacute;c n&agrave;y, ng&ocirc;̀i ở S&agrave;i G&ograve;n, c&ocirc; sẽ l&agrave;m được t&ocirc;́t hơn vi&ecirc;̣c thi&ecirc;̣n nguy&ecirc;̣n của m&igrave;nh.</strong>&nbsp;C&ocirc; sẽ th&agrave;nh l&acirc;̣p m&ocirc;̣t team, bao g&ocirc;̀m lu&acirc;̣t sư, người l&agrave;m truy&ecirc;̀n th&ocirc;ng, k&ecirc;́ to&aacute;n&hellip; h&ocirc;̃ trợ m&igrave;nh. T&ocirc;i đo&aacute;n m&ocirc;̣t người n&ocirc;̉i ti&ecirc;́ng như c&ocirc; đ&atilde; c&oacute;, lu&ocirc;n c&oacute; team h&ocirc;̃ trợ, nhưng m&ocirc;̃i c&ocirc;ng vi&ecirc;̣c, m&ocirc;̃i lĩnh vực c&acirc;̀n chuy&ecirc;n gia ri&ecirc;ng.</p>\r\n\r\n<p>Đơn cử như vi&ecirc;̣c c&ocirc; đưa h&igrave;nh ảnh người phụ nữ &quot;chặn ti&ecirc;̀n&quot; l&ecirc;n mạng, sẽ l&agrave; t&ocirc;́t hơn n&ecirc;́u khu&ocirc;n mặt người kia được che khu&acirc;́t đi. Ti&ecirc;n v&acirc;̃n c&acirc;̀n dằn mặt đ&ocirc;́i tượng v&agrave; cảnh b&aacute;o người kh&aacute;c. Tuy nhi&ecirc;n vi&ecirc;̣c &quot;l&ocirc;̣t tr&acirc;̀n&quot; người ta l&ecirc;n mạng sẽ l&agrave;m những người tử t&ecirc;́ v&agrave; tự trọng khi&ecirc;́p sợ. Ai đ&oacute; c&oacute; &yacute; định đ&ecirc;́n gi&uacute;p Ti&ecirc;n sẽ e ngại, kh&ocirc;ng bi&ecirc;́t nhỡ l&uacute;c m&igrave;nh c&oacute; sai s&oacute;t hay bị hi&ecirc;̉u l&acirc;̀m, m&igrave;nh sẽ bị đưa l&ecirc;n gi&agrave;n thi&ecirc;u dư lu&acirc;̣n như v&acirc;̣y kh&ocirc;ng?..&nbsp; V&ocirc; t&igrave;nh Ti&ecirc;n m&acirc;́t đi cơ h&ocirc;̣i chia sẻ g&aacute;nh nặng v&agrave; lan tỏa c&ocirc;ng vi&ecirc;̣c t&ocirc;́t hơn.</p>\r\n\r\n<p>N&ecirc;́u c&oacute; m&ocirc;̣t chuy&ecirc;n gia truy&ecirc;̀n th&ocirc;ng hay ph&aacute;t tri&ecirc;̉n đi&ecirc;̀m tĩnh, kinh nghi&ecirc;̣m, họ sẽ chỉ cho Ti&ecirc;n vi&ecirc;̣c h&agrave;nh xử sao cho t&ocirc;́t nh&acirc;́t.</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/thuy-tien-3-1603371320037225033725.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Nữ nhà báo nói về việc quản lý 100 tỷ từ thiện của Thủy Tiên: &amp;quot;Cô nên thành lập một team, bao gồm luật sư, truyền thông, kế toán... để hỗ trợ mình&amp;quot; - Ảnh 2.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/22/thuy-tien-3-1603371320037225033725.jpg\" title=\"Nữ nhà báo nói về việc quản lý 100 tỷ từ thiện của Thủy Tiên: &amp;quot;Cô nên thành lập một team, bao gồm luật sư, truyền thông, kế toán... để hỗ trợ mình&amp;quot; - Ảnh 2.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/thuy-tien-2-16033713200391160101527.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Nữ nhà báo nói về việc quản lý 100 tỷ từ thiện của Thủy Tiên: &amp;quot;Cô nên thành lập một team, bao gồm luật sư, truyền thông, kế toán... để hỗ trợ mình&amp;quot; - Ảnh 2.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/22/thuy-tien-2-16033713200391160101527.jpg\" title=\"Nữ nhà báo nói về việc quản lý 100 tỷ từ thiện của Thủy Tiên: &amp;quot;Cô nên thành lập một team, bao gồm luật sư, truyền thông, kế toán... để hỗ trợ mình&amp;quot; - Ảnh 2.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/thuy-tien-1-16033713200421555422451.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Nữ nhà báo nói về việc quản lý 100 tỷ từ thiện của Thủy Tiên: &amp;quot;Cô nên thành lập một team, bao gồm luật sư, truyền thông, kế toán... để hỗ trợ mình&amp;quot; - Ảnh 2.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/22/thuy-tien-1-16033713200421555422451.jpg\" title=\"Nữ nhà báo nói về việc quản lý 100 tỷ từ thiện của Thủy Tiên: &amp;quot;Cô nên thành lập một team, bao gồm luật sư, truyền thông, kế toán... để hỗ trợ mình&amp;quot; - Ảnh 2.\" /></a></p>\r\n\r\n<p>Thủy Ti&ecirc;n x&ocirc;ng pha v&agrave;o mưa lũ, gi&uacute;p đỡ b&agrave; con miền Trung</p>\r\n\r\n<p><strong>3. K&ecirc;́t n&ocirc;́i v&agrave; chia sẻ:</strong>&nbsp;Tr&ecirc;n mạng c&oacute; nhi&ecirc;̀u người ngỏ &yacute; chia sẻ g&aacute;nh nặng trăm tỷ của Ti&ecirc;n. Đừng v&ocirc;̣i đ&aacute;nh đ&ocirc;̀ng họ với những kẻ đục nước b&eacute;o c&ograve; h&aacute;m lợi. Họ l&agrave; những chuy&ecirc;n gia x&acirc;y dựng, c&acirc;̀u đường, nước sạch, nh&agrave; ch&ocirc;́ng lũ&hellip; những con người c&oacute; chuy&ecirc;n m&ocirc;n v&agrave; t&acirc;m huy&ecirc;́t, c&oacute; kinh nghi&ecirc;̣m, họ sẽ l&agrave; những người c&ocirc;̣ng sự đắc lực cho Ti&ecirc;n.</p>\r\n\r\n<p>Bản th&acirc;n những người đứng ra nh&acirc;̣n vi&ecirc;̣c trước đ&aacute;m đ&ocirc;ng, họ đ&atilde; l&agrave; người d&aacute;m l&agrave;m d&aacute;m chịu, v&agrave; họ cũng chịu sự gi&aacute;m s&aacute;t khắt khe của c&ocirc;̣ng đ&ocirc;̀ng. Team của Ti&ecirc;n sẽ th&acirc;̉m định v&agrave; c&ugrave;ng c&ocirc;̣ng đ&ocirc;̀ng gi&aacute;m s&aacute;t v&ecirc;̀ hi&ecirc;̣u quả c&ocirc;ng vi&ecirc;̣c v&agrave; sự minh bạch của họ.</p>\r\n\r\n<p><strong>4. Lan tỏa mạng lưới c&ocirc;̣ng đ&ocirc;̀ng:</strong>&nbsp;V&acirc;̃n bi&ecirc;́t rằng m&ocirc;̣t s&ocirc;́ &quot;con s&acirc;u&quot; l&agrave;m cho một số t&ocirc;̉ chức từ thiện kh&ocirc;ng được tin tưởng, v&agrave; người l&agrave;m thi&ecirc;̣n nguy&ecirc;̣n lu&ocirc;n th&iacute;ch đưa qu&agrave; trực ti&ecirc;́p cho nạn nh&acirc;n. Nhưng thực t&ecirc;́ &quot;sức người c&oacute; hạn&quot; v&agrave; những v&acirc;́n đ&ecirc;̀ kh&aacute;c, như qua nhi&ecirc;̀u năm, v&acirc;̃n c&oacute; hi&ecirc;̣n tượng những gia đ&igrave;nh g&acirc;̀n trục giao th&ocirc;ng, hoặc b&ocirc;̃ng n&ocirc;̉i l&ecirc;n tr&ecirc;n truy&ecirc;̀n th&ocirc;ng với c&acirc;u chuy&ecirc;̣n x&uacute;c đ&ocirc;̣ng n&agrave;o đ&oacute;, l&acirc;̣p tức h&uacute;t h&acirc;̀u h&ecirc;́t ngu&ocirc;̀n t&agrave;i trợ, trong khi những nơi kh&aacute;c kh&ocirc;ng c&oacute;.</p>\r\n\r\n<p>M&acirc;́y h&ocirc;m nay tr&ecirc;n mạng đ&atilde; xu&acirc;́t hi&ecirc;̣n nhi&ecirc;̀u c&acirc;u chuy&ecirc;̣n nhi&ecirc;̀u h&ocirc;̣ nh&agrave; hai t&acirc;̀ng bị c&aacute;c đo&agrave;n cứu trợ phớt lờ, chỉ đ&ecirc;́n những nh&agrave; x&acirc;̣p x&ecirc;̣; trong khi những nh&agrave; t&acirc;̀ng hi&ecirc;̣n l&agrave; đi&ecirc;̉m tr&uacute; ngụ của cả x&oacute;m.</p>\r\n\r\n<p>Mạng lưới d&acirc;n cư r&acirc;́t quan trọng. Người d&acirc;n chịu sự chi ph&ocirc;́i r&acirc;́t lớn với &quot;t&igrave;nh l&agrave;ng nghĩa x&oacute;m&quot;, sợ &quot;s&ocirc;́ng kh&ocirc;ng ra g&igrave;, ch&ecirc;́t kh&ocirc;ng c&oacute; người khi&ecirc;ng&quot;. Đừng v&ocirc;̣i nghĩ &ocirc;ng trưởng th&ocirc;n, b&agrave; trưởng h&ocirc;̣i phụ nữ chỉ nhăm nhăm ăn chặn. Họ l&agrave; người l&agrave;ng của nhau, s&ocirc;́ng với nhau cả đời. Đo&agrave;n từ thi&ecirc;̣n đ&ecirc;́n r&ocirc;̀i đi, nhưng họ sẽ l&agrave; người n&acirc;ng đỡ nhau, kh&ocirc;ng v&igrave; m&oacute;n qu&agrave; từ thi&ecirc;̣n m&agrave; bị l&agrave;ng x&oacute;m t&acirc;̉y chay. Họ sẽ l&agrave; c&aacute;nh tay n&ocirc;́i d&agrave;i đắc lực của c&aacute;c đo&agrave;n thi&ecirc;̣n nguy&ecirc;̣n.</p>\r\n\r\n<p><strong>5. Sử dụng c&ocirc;ng ngh&ecirc;̣:&nbsp;</strong>M&igrave;nh đang h&igrave;nh dung n&ecirc;́u c&oacute; m&ocirc;̣t bản đ&ocirc;̀ s&ocirc;́, g&acirc;̀n gi&ocirc;́ng như sơ đ&ocirc;̀ b&aacute;n v&eacute; của c&aacute;c nh&agrave; h&aacute;t. Trang n&agrave;y c&ocirc;ng khai tr&ecirc;n mạng. C&aacute;c chuy&ecirc;n gia sẽ cung c&acirc;́p bản đ&ocirc;̀, s&ocirc;́ li&ecirc;̣u, h&ocirc;̣ d&acirc;n, c&aacute;c v&ugrave;ng ng&acirc;̣p nặng&hellip; C&aacute;c đo&agrave;n thi&ecirc;̣n nguy&ecirc;̣n sẽ đ&aacute;nh d&acirc;́u những l&agrave;ng, th&acirc;̣m ch&iacute; những h&ocirc;̣ đ&atilde; cứu trợ; c&aacute;c đo&agrave;n sau sẽ t&igrave;m địa đi&ecirc;̉m kh&aacute;c, tr&aacute;nh ch&ocirc;̀ng ch&eacute;o. C&ocirc;ng vi&ecirc;̣c sẽ được ph&acirc;n b&ocirc;̉ hợp l&yacute;, v&agrave; minh bạch hơn. Ph&acirc;̀n m&ecirc;̀m n&agrave;y sẽ được lưu lại đ&ecirc;̉ d&ugrave;ng cho c&aacute;c đợt sau nữa.</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/22/thuy-tien-5-16033713200321435242386.jpg\" target=\"_blank\" title=\"Thủy Tiên và trợ lý đang bàn bạc về kế hoạch làm từ thiện\"><img alt=\"Nữ nhà báo nói về việc quản lý 100 tỷ từ thiện của Thủy Tiên: Cô nên thành lập một team, bao gồm luật sư, truyền thông, kế toán... để hỗ trợ mình - Ảnh 3.\" id=\"img_d7513d10-1465-11eb-bcc6-f77c8cb8ff6c\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/thuy-tien-5-16033713200321435242386.jpg\" title=\"Nữ nhà báo nói về việc quản lý 100 tỷ từ thiện của Thủy Tiên: Cô nên thành lập một team, bao gồm luật sư, truyền thông, kế toán... để hỗ trợ mình - Ảnh 3.\" /></a></p>\r\n\r\n<p>Thủy Ti&ecirc;n v&agrave; trợ l&yacute; đang b&agrave;n bạc về kế hoạch l&agrave;m từ thiện</p>\r\n\r\n<p>Cuối c&ugrave;ng, nh&agrave; b&aacute;o Thu Hường cho biết đ&acirc;y là&nbsp;những đ&ecirc;̀ xu&acirc;́t trong t&acirc;̀m hi&ecirc;̉u bi&ecirc;́t của m&igrave;nh, mong được b&ocirc;̉ sung th&ecirc;m; kh&ocirc;ng chỉ v&igrave; &quot;c&ocirc; Ti&ecirc;n&quot; v&agrave; v&igrave; ngu&ocirc;̀n t&agrave;i nguy&ecirc;n thi&ecirc;̣n nguy&ecirc;̣n v&agrave; ni&ecirc;̀m tin c&ocirc;̣ng đ&ocirc;̀ng c&acirc;̀n được bảo v&ecirc;̣.</p>\r\n\r\n<p>Hiện tại, những chia sẻ của nh&agrave; b&aacute;o Ho&agrave;ng Thu Hường tr&ecirc;n trang c&aacute; nh&acirc;n đang nhận được sự quan t&acirc;m rất lớn của cộng đồng mạng.</p>\r\n\r\n<p>Ho&agrave;ng Thu Hường sinh năm 1977 tại Lạng Sơn, sống v&agrave; l&agrave;m việc chủ yếu tại H&agrave; Nội. C&ocirc; l&agrave; một nh&agrave; b&aacute;o, diễn vi&ecirc;n Việt Nam v&agrave; l&agrave; vợ của v&otilde; sư karate Đo&agrave;n Bảo Ch&acirc;u</p>\r\n\r\n<p><img alt=\"117718106_10214993073575157_6119184460618887257_o\" id=\"img_834f4db0-146f-11eb-800f-fffacad656d9\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/22/117718106102149930735751576119184460618887257o-16033754645291720860002.jpg\" title=\"117718106_10214993073575157_6119184460618887257_o\" /></p>\r\n\r\n<p>Nh&agrave; b&aacute;o Ho&agrave;ng Thu Hường.</p>\r\n\r\n<p>Trước khi được biết tới vai tr&ograve; l&agrave; nh&agrave; b&aacute;o, Ho&agrave;ng Thu Hường được biết tới l&agrave; diễn vi&ecirc;n để lại dấu ấn đạm n&eacute;t trong nhiều bộ phim truyền h&igrave;nh. Gần đ&acirc;y nhất trong con sốt của bộ phim &quot;Sống chung với mẹ chồng&quot;, nh&agrave; b&aacute;o Ho&agrave;ng Hường đ&atilde; viết một bức t&acirc;m thư gửi tới người con d&acirc;u tương lai của m&igrave;nh với những từ ngữ đấy th&uacute; vị đ&atilde; thu h&uacute;t được nhiều người đọc v&agrave; chia sẻ.</p>\r\n', 'nu-nha-bao-noi-ve-viec-quan-ly-100-ty-tu-thien-cua-thuy-tien-co-nen-thanh-lap-mot-team-bao-gom-luat-su-truyen-thong-ke-toan-de-ho-tro-minh', 'vi', null, null, '1603383102', '1', '1', '1', '', '', '', '', '5', '1', '1', '0');
INSERT INTO news VALUES ('14', 'Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng', '<h2>Trận lũ lịch sử đi qua, cuốn theo bao t&agrave;i sản, c&ocirc;ng sức m&agrave; người d&acirc;n Quảng B&igrave;nh g&acirc;y dựng bao năm nay. T&agrave;i sản tr&ocirc;i theo d&ograve;ng nước, nhiều ng&ocirc;i nh&agrave; bị lũ đ&aacute;nh sập, giờ đ&acirc;y người d&acirc;n kh&ocirc;ng biết sẽ sống như thế n&agrave;o trong thời gian tới.</h2>\r\n', '1', 'upload/img/news/anhnuoclu.png', '<p>Sau những trận lũ li&ecirc;n tiếp vừa qua, tại tỉnh Quảng B&igrave;nh, trời đ&atilde; hửng nắng 2 ng&agrave;y nay, nước đ&atilde; r&uacute;t mạnh, nhiều nơi người d&acirc;n tranh thủ dọn dẹp, t&igrave;m kiếm t&agrave;i sản c&ograve;n s&oacute;t lại.</p>\r\n\r\n<p>Ghi nhận của PV, hiện một số khu vực của huyện Lệ Thủy vẫn c&ograve;n ngập s&acirc;u như x&atilde; An Thủy, Phong Thủy.</p>\r\n\r\n<p>C&ocirc;ng t&aacute;c cứu trợ người d&acirc;n cũng đang diễn ra hết sức khẩn trương, đảm bảo người d&acirc;n c&oacute; nước sạch, thực phẩm để sử dụng. Sau lũ, nhiều gia đ&igrave;nh l&acirc;m v&agrave;o cảnh bi đ&aacute;t khi t&agrave;i sản trong gia đ&igrave;nh đ&atilde; theo d&ograve;ng nước, nhiều nơi nh&agrave; cũng sập ho&agrave;n to&agrave;n, kh&ocirc;ng c&ograve;n nơi tr&uacute; ngụ.</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z2140846498098783338fdfd3e7d099eb0af2d69ca9265-16034419274191999163564-1603442071088305286674.png\" target=\"_blank\" title=\"Tại xã An Thủy, huyện Lệ Thủy nước bắt đầu rút nhưng vẫn còn rút chậm. Nhiều gia đình ở đây đã bắt tay dọn dẹp nhà cửa\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 1.\" id=\"img_3dc9be60-150a-11eb-b636-b9228326495b\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/23/z2140846498098783338fdfd3e7d099eb0af2d69ca9265-16034419274191999163564-1603442071088305286674.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 1.\" /></a></p>\r\n\r\n<p>Tại x&atilde; An Thủy, huyện Lệ Thủy nước bắt đầu r&uacute;t nhưng vẫn c&ograve;n r&uacute;t chậm. Nhiều gia đ&igrave;nh ở đ&acirc;y đ&atilde; bắt tay dọn dẹp nh&agrave; cửa</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z214084660739781012355b97faff50ab8ec9bef1613f9-16034419840331637468807-16034420797701680934605.png\" target=\"_blank\" title=\"Nước lũ mang theo nhiều tài sản của người dân trôi đi. Nhiều người khi nhìn vào cảnh tượng này đều không kìm nén được nỗi đau\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 2.\" id=\"img_604ce340-150a-11eb-9375-313df137076a\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/23/z214084660739781012355b97faff50ab8ec9bef1613f9-16034419840331637468807-16034420797701680934605.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 2.\" /></a></p>\r\n\r\n<p>Nước lũ mang theo nhiều t&agrave;i sản của người d&acirc;n tr&ocirc;i đi. Nhiều người khi nh&igrave;n v&agrave;o cảnh tượng n&agrave;y đều kh&ocirc;ng k&igrave;m n&eacute;n được nỗi đau</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z2140846535201bc9049016a7e3d5a8fbf3b1957f4c33f-16034420959132084264429-16034422158881485855030.png\" rel=\"lightbox\" title=\"\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 3.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/z2140846535201bc9049016a7e3d5a8fbf3b1957f4c33f-16034420959132084264429-16034422158881485855030.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 3.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z2140846476081ea4c18fac673caee46a9a777a282d42e-1603442095907581469938-1603442131670238009859.png\" rel=\"lightbox\" title=\"\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 3.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/z2140846476081ea4c18fac673caee46a9a777a282d42e-1603442095907581469938-1603442131670238009859.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 3.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z21408463995185dbf822dd4985edcd71156edb5685d66-16034420959031367444867-1603442123504579004729.png\" rel=\"lightbox\" title=\"\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 3.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/z21408463995185dbf822dd4985edcd71156edb5685d66-16034420959031367444867-1603442123504579004729.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 3.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z2140846353539233801a7457058d482d9072869cfacf4-16034420958982137352369-1603442116331436891979.png\" rel=\"lightbox\" title=\"\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 3.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/z2140846353539233801a7457058d482d9072869cfacf4-16034420958982137352369-1603442116331436891979.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 3.\" /></a></p>\r\n\r\n<p>Cảnh hoang t&agrave;n đổ n&aacute;t ở x&atilde; An Thủy, huyện Lệ Thủy</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z21408457406471eeef14670713b04e2351efa60eb1d9a-1603442265744396659775.jpg\" target=\"_blank\" title=\"Tại xã Hồng Thủy, nhiều ngôi nhà của người dân đã bị nước lũ đánh sập\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 4.\" id=\"img_05caea60-150b-11eb-8323-7db817137833\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/23/z21408457406471eeef14670713b04e2351efa60eb1d9a-1603442265744396659775.jpg\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 4.\" /></a></p>\r\n\r\n<p>Tại x&atilde; Hồng Thủy, nhiều ng&ocirc;i nh&agrave; của người d&acirc;n đ&atilde; bị nước lũ đ&aacute;nh sập</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z2140845789551a10b5e485fd0db17959c68810cee0e3d-16034423063811150137520-16034423304261478573916.png\" target=\"_blank\" title=\"Theo người dân ở địa phương, nước lũ dâng cao, sóng lớn khiến nhiều ngôi nhà bị đánh sập. Nước rút nhưng nhiều gia đình giờ chẳng còn nhà để ở, tài sản cũng không còn thứ gì\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 5.\" id=\"img_1e1c8060-150b-11eb-90fe-8d764074f447\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/23/z2140845789551a10b5e485fd0db17959c68810cee0e3d-16034423063811150137520-16034423304261478573916.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 5.\" /></a></p>\r\n\r\n<p>Theo người d&acirc;n ở địa phương, nước lũ d&acirc;ng cao, s&oacute;ng lớn khiến nhiều ng&ocirc;i nh&agrave; bị đ&aacute;nh sập. Nước r&uacute;t nhưng nhiều gia đ&igrave;nh giờ chẳng c&ograve;n nh&agrave; để ở, t&agrave;i sản cũng kh&ocirc;ng c&ograve;n thứ g&igrave;</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z2140846082175ed2bb44f71d775ca2177061524dc9991-1603442391179654300439-1603442555493786974190.png\" target=\"_blank\" title=\"Ông Nguyễn Nồng (78 tuổi) đứng trong căn nhà đã sập đổ của mình. Giờ đây ông và người vợ 78 tuổi không còn nơi nào để trú\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 6.\" id=\"img_508ddcb0-150b-11eb-a842-3f4ef79bb4ed\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/23/z2140846082175ed2bb44f71d775ca2177061524dc9991-1603442391179654300439-1603442555493786974190.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 6.\" /></a></p>\r\n\r\n<p>&Ocirc;ng Nguyễn Nồng (78 tuổi) đứng trong căn nh&agrave; đ&atilde; sập đổ của m&igrave;nh. Giờ đ&acirc;y &ocirc;ng v&agrave; người vợ 78 tuổi kh&ocirc;ng c&ograve;n nơi n&agrave;o để tr&uacute;</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z2140846120509ddb927e7a42e70e82d1f3e67f117a5c5-1603442472399581222901-16034425632341910210764.png\" target=\"_blank\" title=\"Vợ ông sang nhà hàng xóm nhờ họ xin ít mỳ tôm cứu trợ để về ăn. Một mình ông Nồng đi lại trong căn nhà đổ nát, cố tìm kiếm những thứ sót lại nhưng chẳng còn gì. Ông nói đêm hôm bị sập, ông bà chạy được sang nhà hàng xóm không thì đã chết\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 7.\" id=\"img_80e18920-150b-11eb-aa02-09d255b83f7e\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/23/z2140846120509ddb927e7a42e70e82d1f3e67f117a5c5-1603442472399581222901-16034425632341910210764.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 7.\" /></a></p>\r\n\r\n<p>Vợ &ocirc;ng sang nh&agrave; h&agrave;ng x&oacute;m nhờ họ xin &iacute;t mỳ t&ocirc;m cứu trợ để về ăn. Một m&igrave;nh &ocirc;ng Nồng đi lại trong căn nh&agrave; đổ n&aacute;t, cố t&igrave;m kiếm những thứ s&oacute;t lại nhưng chẳng c&ograve;n g&igrave;. &Ocirc;ng n&oacute;i đ&ecirc;m h&ocirc;m bị sập, &ocirc;ng b&agrave; chạy được sang nh&agrave; h&agrave;ng x&oacute;m kh&ocirc;ng th&igrave; đ&atilde; chết</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z2140846162220bf7fc5b934352a773ce3651e37fb97e2-16034425948671102986510-1603442646445681085192.png\" rel=\"lightbox\" title=\"\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 8.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/z2140846162220bf7fc5b934352a773ce3651e37fb97e2-16034425948671102986510-1603442646445681085192.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 8.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z2140845974792875005f67b663f844570b7ed8c46693c-16034425948643741544-1603442637349889214068.png\" rel=\"lightbox\" title=\"\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 8.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/z2140845974792875005f67b663f844570b7ed8c46693c-16034425948643741544-1603442637349889214068.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 8.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z21408458366581736e208e19a5f2b8696ed631f8bb9a8-1603442594857717140912-16034426256631917122152.png\" rel=\"lightbox\" title=\"\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 8.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/z21408458366581736e208e19a5f2b8696ed631f8bb9a8-1603442594857717140912-16034426256631917122152.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 8.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z214084591656397faf533e8692006d01acf1374146fc5-1603442594861648839077-1603442611166617618863.png\" rel=\"lightbox\" title=\"\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 8.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/z214084591656397faf533e8692006d01acf1374146fc5-1603442594861648839077-1603442611166617618863.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 8.\" /></a></p>\r\n\r\n<p>Chẳng c&ograve;n g&igrave; để mất sau cơn lũ dữ</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z21408460449113e7a848caf4b8f0e9771bd0580df4c68-16034427058421695882103-16034427636101998354703.png\" target=\"_blank\" title=\"Thiệt hại do cơn lũ gây ra vượt quá sức chịu đựng của người dân. Giờ đây họ chỉ còn cách cầu cứu sự trợ giúp của chính quyền\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 9.\" id=\"img_0bf52c60-150c-11eb-a842-3f4ef79bb4ed\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/23/z21408460449113e7a848caf4b8f0e9771bd0580df4c68-16034427058421695882103-16034427636101998354703.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 9.\" /></a></p>\r\n\r\n<p>Thiệt hại do cơn lũ g&acirc;y ra vượt qu&aacute; sức chịu đựng của người d&acirc;n. Giờ đ&acirc;y họ chỉ c&ograve;n c&aacute;ch cầu cứu sự trợ gi&uacute;p của ch&iacute;nh quyền</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z21408463047345de850eb529d311fb7a9f1384fb8c4f0-16034427902711349851846-16034428303571244861268.png\" rel=\"lightbox\" title=\"\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 10.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/z21408463047345de850eb529d311fb7a9f1384fb8c4f0-16034427902711349851846-16034428303571244861268.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 10.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z2140846264401763e11b49a934cb0c0b08464639a5d01-16034427902672007237639-1603442822571707976687.png\" rel=\"lightbox\" title=\"\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 10.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/z2140846264401763e11b49a934cb0c0b08464639a5d01-16034427902672007237639-1603442822571707976687.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 10.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/z2140846214077a78a9c9ce771998981dc17611cec27e5-1603442790263627507386-1603442813870681928841.png\" rel=\"lightbox\" title=\"\"><img alt=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 10.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/z2140846214077a78a9c9ce771998981dc17611cec27e5-1603442790263627507386-1603442813870681928841.png\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng - Ảnh 10.\" /></a></p>\r\n\r\n<p>H&igrave;nh ảnh khiến bất cứ ai cũng x&oacute;t xa</p>\r\n\r\n<p><a href=\"javascript:void(0);\" rel=\"nofollow\" title=\"Theo Trí Thức Trẻ\">Theo&nbsp;Tr&iacute; Thức Trẻ&nbsp;<em>Copy link</em></a></p>\r\n', 'anh-nuoc-lu-cuon-troi-nhieu-can-nha-nguoi-dan-quang-binh-co-tim-kiem-chut-tai-san-con-sot-lai-trong-vo-vong', 'vi', null, null, '1603466227', '19', '1', '1', '', '', '', '', null, '1', '1', '0');
INSERT INTO news VALUES ('15', 'Người miền Tây tập hợp nhau tự sáng tạo \"loại bánh mới\" dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã \"thần tốc\" gói 5.000 chiếc!', '<p>Chiếc b&aacute;nh chẳng phải l&agrave; b&aacute;nh chưng, cũng hao hao như b&aacute;nh giầy thế nhưng vẫn kh&ocirc;ng ai c&oacute; thể n&oacute;i ch&iacute;nh x&aacute;c c&aacute;i t&ecirc;n của n&oacute;,&nbsp;</p>\r\n', '1', 'upload/img/news/mientay.jpg', '<h2>5.000 chiếc b&aacute;nh được g&oacute;i trong nửa ng&agrave;y quả thật l&agrave;m ch&uacute;ng t&ocirc;i x&uacute;c động. V&agrave; c&oacute; lẽ đ&acirc;y l&agrave; điều chưa từng c&oacute; tiền lệ ở miền T&acirc;y!</h2>\r\n\r\n<ul>\r\n	<li><a href=\"https://kenh14.vn/gap-nan-tren-duong-cuu-tro-lu-lut-mien-trung-tai-xe-bi-chan-thuong-so-nao-20201023175551866.chn\" title=\"Gặp nạn trên đường cứu trợ lũ lụt miền Trung, tài xế bị chấn thương sọ não\">Gặp nạn tr&ecirc;n đường cứu trợ lũ lụt miền Trung, t&agrave;i xế bị chấn thương sọ n&atilde;o&nbsp;</a></li>\r\n	<li><a href=\"https://kenh14.vn/thieu-ta-cong-an-ke-chuyen-cuu-3-cu-gia-3-chau-nho-trong-con-nuoc-lu-20201023161736678.chn\" title=\"Thiếu tá công an kể chuyện cứu 3 cụ già, 3 cháu nhỏ trong cơn nước lũ\">Thiếu t&aacute; c&ocirc;ng an kể chuyện cứu 3 cụ gi&agrave;, 3 ch&aacute;u nhỏ trong cơn nước lũ&nbsp;</a></li>\r\n	<li><a href=\"https://kenh14.vn/anh-nuoc-lu-cuon-troi-nhieu-can-nha-nguoi-dan-quang-binh-khoc-can-nuoc-mat-cau-cuu-giup-do-20201023155150413.chn\" title=\"Ảnh: Nước lũ cuốn trôi nhiều căn nhà, người dân Quảng Bình cố tìm kiếm chút tài sản còn sót lại trong vô vọng\">Ảnh: Nước lũ cuốn tr&ocirc;i nhiều căn nh&agrave;, người d&acirc;n Quảng B&igrave;nh cố t&igrave;m kiếm ch&uacute;t t&agrave;i sản c&ograve;n s&oacute;t lại trong v&ocirc; vọng&nbsp;</a></li>\r\n</ul>\r\n\r\n<p>Chiếc b&aacute;nh chẳng phải l&agrave; b&aacute;nh chưng, cũng hao hao như b&aacute;nh giầy thế nhưng vẫn kh&ocirc;ng ai c&oacute; thể n&oacute;i ch&iacute;nh x&aacute;c c&aacute;i t&ecirc;n của n&oacute;, chỉ c&oacute; thể thừa nhận rằng người miền T&acirc;y chưa từng g&oacute;i loại b&aacute;nh n&agrave;y trong tiền lệ, ở thời điểm h&agrave;ng ngh&igrave;n người miền Trung đang chịu đ&oacute;i họ chỉ c&oacute; thể vận dụng sự s&aacute;ng tạo trong c&ocirc;ng cuộc lao động, sản xuất, tập hợp c&ugrave;ng nhau gửi ch&uacute;t th&acirc;n t&igrave;nh cho đồng b&agrave;o m&igrave;nh.</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-1-16034585842721597057837.jpg\" target=\"_blank\" title=\"Những người phụ nữ ở Cần Thơ đã tập hợp nhau cùng nghĩ ra loại bánh phù hợp hơn cho việc mang ra miền Trung.\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo loại bánh mới dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã thần tốc gói 5.000 chiếc! - Ảnh 1.\" id=\"img_093214f0-1531-11eb-b636-b9228326495b\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/23/photo-1-16034585842721597057837.jpg\" title=\"Người miền Tây tập hợp nhau tự sáng tạo loại bánh mới dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã thần tốc gói 5.000 chiếc! - Ảnh 1.\" /></a></p>\r\n\r\n<p>Những người phụ nữ ở Cần Thơ đ&atilde; tập hợp nhau c&ugrave;ng nghĩ ra loại b&aacute;nh ph&ugrave; hợp hơn cho việc mang ra miền Trung.</p>\r\n\r\n<p><strong>S&Aacute;NG TẠO LOẠI B&Aacute;NH MỚI, MỖI C&Aacute;I TƯƠNG ĐƯƠNG 2 B&Aacute;T CƠM, BẢO QUẢN ĐƯỢC NHIỀU NG&Agrave;Y</strong></p>\r\n\r\n<p>T&ocirc;i phải mất đến v&agrave;i ph&uacute;t để nh&igrave;n ra chiếc b&aacute;nh tr&ecirc;n tay người d&acirc;n đang tỉ mỉ g&oacute;i l&agrave; b&aacute;nh g&igrave;, bởi trong lịch sử ẩm thực v&ugrave;ng miền n&oacute;i chung t&ocirc;i chưa từng thấy loại b&aacute;nh n&agrave;y. Hỏi ra mới biết, b&aacute;nh l&agrave; một sản phẩm s&aacute;ng tạo cấp b&aacute;ch của người Cần Thơ nhằm tiết kiệm thời gian g&oacute;i, mỗi c&aacute;i b&aacute;nh tương đương với hơn 2 b&aacute;t cơm vừa đủ một người lớn ăn, kh&ocirc;ng l&atilde;ng ph&iacute; v&agrave; đặc biệt l&agrave; dễ bảo quản.</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-1-1603458592808886905930.jpg\" target=\"_blank\" title=\"Từng tấm lá chuối được lau vô cùng kỹ lưỡng trước khi bước vào công đoạn gói.\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo loại bánh mới dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã thần tốc gói 5.000 chiếc! - Ảnh 2.\" id=\"img_0c509300-1531-11eb-b4b1-873f29055c0e\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/23/photo-1-1603458592808886905930.jpg\" title=\"Người miền Tây tập hợp nhau tự sáng tạo loại bánh mới dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã thần tốc gói 5.000 chiếc! - Ảnh 2.\" /></a></p>\r\n\r\n<p>Từng tấm l&aacute; chuối được lau v&ocirc; c&ugrave;ng kỹ lưỡng trước khi bước v&agrave;o c&ocirc;ng đoạn g&oacute;i.</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-2-16034585928121063791946.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 3.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-2-16034585928121063791946.jpg\" title=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 3.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-1-1603458592808886905930.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 3.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-1-1603458592808886905930.jpg\" title=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 3.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-4-1603458592821843734137.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 3.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-4-1603458592821843734137.jpg\" title=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 3.\" /></a></p>\r\n\r\n<p>Do người miền T&acirc;y vốn hay l&agrave;m b&aacute;nh, n&ecirc;n m&aacute;y m&oacute;c, dụng cụ chỉ cần &quot;ới nhau&quot; l&agrave; c&oacute; sẵn hết.</p>\r\n\r\n<p>Kh&ocirc;ng g&oacute;i b&aacute;nh chưng, người miền T&acirc;y sử dụng những nguy&ecirc;n liệu tương tự l&agrave; nếp, thịt lợn sau đ&oacute; cho v&agrave;o trong l&aacute; chuối g&oacute;i th&agrave;nh cuộn, buộc d&acirc;y b&ecirc;n ngo&agrave;i sau đ&oacute; hấp ch&iacute;n h&igrave;nh th&agrave;nh chiếc b&aacute;nh thơm thảo tấm ch&acirc;n t&igrave;nh của người Cần Thơ.</p>\r\n\r\n<p>Nếp phải ng&acirc;m nhiều giờ liền v&agrave; được x&agrave;o sơ qua tr&ecirc;n chảo, l&aacute; chuối được lau kỹ c&agrave;ng, thịt cũng đ&atilde; qua sơ chế v&agrave; ướp sẵn hương vị, h&agrave;ng trăm người ngồi lại chuyền tay nhau h&igrave; hục g&oacute;i b&aacute;nh theo từng c&ocirc;ng đoạn từ đ&oacute;ng nh&acirc;n đến việc cột d&acirc;y.</p>\r\n\r\n<p>Vội chứ kh&ocirc;ng ẩu, chỉ v&igrave; sợ đồng b&agrave;o m&igrave;nh ngo&agrave;i kia sẽ bỏ cuộc!</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-5-1603