lần ăn n&ecirc;n kh&ocirc;ng ảnh hưởng nhiều đến qu&aacute; tr&igrave;nh bảo quản.</p>\r\n\r\n<p>Những hộp cơm chưa kịp ăn c&ograve;n để b&ecirc;n cạnh, m&agrave;u l&aacute; chuối xanh mơn mởn v&agrave; sạch trơn v&igrave; đ&atilde; được lau qua v&agrave;i lần, cứ hết m&acirc;m l&aacute; n&agrave;y đến m&acirc;m l&aacute; kh&aacute;c, số lượng nếp, thịt v&agrave; d&acirc;y buộc cứ thay phi&ecirc;n nhau vơi rồi lại đầy, kh&ocirc;ng kh&iacute; vừa khẩn trương, vừa ấm c&uacute;ng.</p>\r\n\r\n<p>Theo t&igrave;m hiểu, nh&acirc;n lực g&oacute;i l&agrave; người d&acirc;n trong th&agrave;nh phố, c&ocirc;ng việc được chia đều, thanh ni&ecirc;n sức d&agrave;i vai rộng sẽ l&agrave; lực lượng tiếp nhận việc vận chuyển v&agrave; chặt chuối, c&ograve;n c&aacute;c c&ocirc;, c&aacute;c chị th&igrave; thay phi&ecirc;n nhau g&oacute;i b&aacute;nh, cột d&acirc;y. Kinh ph&iacute; cho đợt g&oacute;i b&aacute;nh n&agrave;y được vận động từ b&agrave; con l&acirc;n cận, người g&oacute;p sức người g&oacute;p c&ocirc;ng. B&aacute;nh sau khi hấp ch&iacute;n sẽ được h&uacute;t ch&acirc;n kh&ocirc;ng để bảo quản được l&acirc;u hơn.</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-8-16034585928521340655571.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 5.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-8-16034585928521340655571.jpg\" title=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 5.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-9-16034585928561437238990.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 5.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-9-16034585928561437238990.jpg\" title=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 5.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-10-16034585928591375267829.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 5.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-10-16034585928591375267829.jpg\" title=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 5.\" /></a></p>\r\n\r\n<p>T&igrave;nh người l&uacute;c n&agrave;y l&agrave; tr&ecirc;n hết, nhưng sau khi nh&igrave;n thấy những kh&oacute; khăn v&agrave; bất cập từ việc mang b&aacute;nh v&agrave; d&ugrave;ng b&aacute;nh, người miền T&acirc;y hy vọng phương ph&aacute;p n&agrave;y của họ sẽ thật sự hữu dụng.</p>\r\n\r\n<p>Phải n&oacute;i rằng g&oacute;i b&aacute;nh l&agrave; một hoạt động đặc trưng của người miền T&acirc;y v&agrave;o những dịp quan trọng trong gia đ&igrave;nh như ng&agrave;y Tết, ng&agrave;y giỗ hoặc cưới,... V&agrave; c&oacute; lẽ ngay thời điểm n&agrave;y, việc viện trợ miền Trung cũng l&agrave; một việc cực kỳ quan trọng khiến họ lập tức nghĩ đến n&eacute;t đặc trưng miền m&igrave;nh v&agrave; t&aacute;i hiện n&oacute; lại trong kh&ocirc;ng kh&iacute; ấm c&uacute;ng v&agrave; chan chứa sự hy vọng, mong cho miền Trung qua khỏi &aacute;ch nạn của cơn đại hồng thủy lần n&agrave;y!</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>NGƯỜI CẦN THƠ CHIA TH&Agrave;NH 2 CHIẾN TUYẾN, C&Oacute; NH&Oacute;M Đ&Atilde; Ở MIỀN TRUNG, VẬN CHUYỂN B&Aacute;NH BẰNG ĐƯỜNG H&Agrave;NG KH&Ocirc;NG</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Theo t&igrave;m hiểu, b&aacute;nh sẽ được c&aacute;c người d&acirc;n sắp xếp vận chuyển bằng đường h&agrave;ng kh&ocirc;ng. B&ecirc;n cạnh ủng hộ lương thực, người d&acirc;n Cần Thơ c&ograve;n k&ecirc;u gọi nhau quy&ecirc;n g&oacute;p v&agrave; mua nhu yếu phẩm, phao cứu sinh để gửi miền Trung bằng đường vận tải. Một nh&oacute;m người đ&atilde; được ph&acirc;n c&ocirc;ng đến c&aacute;c khu vực lũ lụt để tiếp nhận h&agrave;ng h&oacute;a v&agrave; nh&oacute;m n&agrave;y c&oacute; nhiệm vụ ph&aacute;t cho từng hộ d&acirc;n.</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-11-16034585928631796999574.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 6.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-11-16034585928631796999574.jpg\" title=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 6.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-12-16034585928741573631406.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 6.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-12-16034585928741573631406.jpg\" title=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 6.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-13-16034585928771578961535.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 6.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-13-16034585928771578961535.jpg\" title=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 6.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-14-1603458592879914897967.jpg\" target=\"_blank\" title=\"Từng đòn bánh được hấp chín kỹ, lau chùi cẩn thận sau khi chín và tiến hành đóng gói để bánh được bảo quản tốt nhất.\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo loại bánh mới dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã thần tốc gói 5.000 chiếc! - Ảnh 7.\" id=\"img_0fcdd2e0-1531-11eb-98db-5f14a87c7980\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/23/photo-14-1603458592879914897967.jpg\" title=\"Người miền Tây tập hợp nhau tự sáng tạo loại bánh mới dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã thần tốc gói 5.000 chiếc! - Ảnh 7.\" /></a></p>\r\n\r\n<p>Từng đ&ograve;n b&aacute;nh được hấp ch&iacute;n kỹ, lau ch&ugrave;i cẩn thận sau khi ch&iacute;n v&agrave; tiến h&agrave;nh đ&oacute;ng g&oacute;i để b&aacute;nh được bảo quản tốt nhất.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tất cả những điều tr&ecirc;n l&agrave;m t&ocirc;i x&uacute;c động tưởng tượng lại h&igrave;nh ảnh m&agrave; m&igrave;nh thường nghe kể trong c&acirc;u chuyện tiếp sức thời chiến. Mỗi người d&acirc;n Cần Thơ giờ đ&atilde; th&agrave;nh một &quot;vũ kh&iacute;&quot; chống t&ecirc;n &quot;giặc&quot; lũ lụt đang tr&agrave;n về lấn &aacute;t đồng b&agrave;o m&igrave;nh.</p>\r\n\r\n<p>Gần trăm người phụ nữ ngồi nhiều giờ liền để g&oacute;i b&aacute;nh kh&ocirc;ng mỏi, ai c&oacute; sức dai hơn th&igrave; chạy ra chạy v&agrave;o thay l&aacute;, thay nếp, thay nh&acirc;n li&ecirc;n tục, lửa cũng được đốt sẵn ngo&agrave;i trời dưới một c&aacute;i nồi nước thật to, v&igrave; miền Trung cả đấy!</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-15-1603458592881766681110.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 8.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-15-1603458592881766681110.jpg\" title=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 8.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-16-1603458592895410946126.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 8.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-16-1603458592895410946126.jpg\" title=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh mới&amp;quot; dễ bảo quản, có thể tích trữ được nhiều ngày để gửi về miền Trung, mới 12 tiếng đã &amp;quot;thần tốc&amp;quot; gói 5.000 chiếc! - Ảnh 8.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-17-1603458592897960335452.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Người miền Tây tập hợp nhau tự sáng tạo &amp;quot;loại bánh m