=\"javascript:void(0);\" rel=\"nofollow\" title=\"Theo Pháp luật &amp; Bạn đọc\">Theo&nbsp;Ph&aacute;p luật &amp; Bạn đọc&nbsp;<em>Copy link</em></a></p>\r\n', 'hoi-gai-tay-co-7-chieu-dien-cardigan-dep-xin-ngat-ngay-hoc-theo-thi-style-mua-lanh-cua-ban-se-sang-trang', 'vi', null, null, '1603466563', '15', null, '1', '', '', '', '', null, '1', '0', '0');
INSERT INTO news VALUES ('17', 'Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng \"kẻ tám lạng, người nửa cân\" khi so Đệ nhất phu nhân Mỹ với bà Jill Biden', '<h2>Đệ nhất phu nh&acirc;n Mỹ Melania Trump v&agrave; b&agrave; Jill Biden thời ni&ecirc;n thiếu đều l&agrave; những c&ocirc; g&aacute;i xinh đẹp v&agrave; tỏa s&aacute;ng, c&oacute; sự nghiệp ri&ecirc;ng đầy rực rỡ.</h2>\r\n', '1', 'upload/img/news/kinh-1.jpg', '<p>V&agrave;o ng&agrave;y 22/10, Đệ nhất phu nh&acirc;n Melania Trump c&ugrave;ng b&agrave; Jill Biden tiếp tục trở th&agrave;nh t&acirc;m điểm ch&uacute; &yacute; của giới truyền th&ocirc;ng khi cả hai người phụ nữ đối mặt nhau trong cuộc tranh luận giữa Tổng thống Mỹ với đối thủ Joe Biden. Dư luận đ&atilde; c&oacute; những so s&aacute;nh, đ&aacute;nh gi&aacute; về hai người phụ nữ từ phong c&aacute;ch thời trang cho đến việc họ thể hiện t&igrave;nh cảm với chồng m&igrave;nh như thế n&agrave;o trước c&ocirc;ng ch&uacute;ng.</p>\r\n\r\n<p>Đặc biệt, nhan sắc thời trẻ của họ cũng nhận được sự quan t&acirc;m đặc biệt của nhiều người. C&oacute; thể thấy rằng, khi c&ograve;n l&agrave; những c&ocirc; g&aacute;i xu&acirc;n sắc, điểm giống nhau giữa Đệ nhất phu nh&acirc;n Mỹ v&agrave; b&agrave; Jill Biden đ&oacute; l&agrave; đều sở hữu n&eacute;t đẹp quyến rũ, h&uacute;t hồn c&ugrave;ng sự nghiệp ri&ecirc;ng đầy rực rỡ.</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-1-16034526521411551758860.jpg\" target=\"_blank\" title=\"Bà Jill Biden cùng Đệ nhất phu nhân Mỹ trong cuộc tranh luận đầu tiên vào cuối tháng 9 vừa qua\"><img alt=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng kẻ tám lạng, người nửa cân khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 1.\" id=\"img_364fa500-1523-11eb-9893-4917f02b553e\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/23/photo-1-16034526521411551758860.jpg\" title=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng kẻ tám lạng, người nửa cân khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 1.\" /></a></p>\r\n\r\n<p>B&agrave; Jill Biden c&ugrave;ng Đệ nhất phu nh&acirc;n Mỹ trong cuộc tranh luận đầu ti&ecirc;n v&agrave;o cuối th&aacute;ng 9 vừa qua</p>\r\n\r\n<p>B&agrave; Melania Trump bắt đầu trở th&agrave;nh một người mẫu chuy&ecirc;n nghiệp ở tuổi 16. V&agrave;o thời điểm đ&oacute; b&agrave; nổi bật với gương mặt tr&agrave;n đầy sức sống v&agrave; đ&ocirc;i mắt s&aacute;ng h&uacute;t hồn c&ugrave;ng v&oacute;c d&aacute;ng cao r&aacute;o, c&acirc;n đối. Chỉ sau hơn 2 năm v&agrave;o nghề, b&agrave; đ&atilde; k&yacute; hợp đồng với một c&ocirc;ng ty ở Milan, &Yacute;.</p>\r\n\r\n<p>B&agrave; Jill Biden ngay khi ngồi tr&ecirc;n ghế nh&agrave; trường đ&atilde; l&agrave; một nữ sinh xuất sắc. Về sau b&agrave; c&oacute; 2 bằng thạc sĩ v&agrave; sau đ&oacute; trở th&agrave;nh tiến sĩ gi&aacute;o dục tại Đại học Delaware. B&agrave; Jill đ&atilde; giảng dạy tại nhiều trường cao đẳng cộng đồng v&agrave; b&agrave; được đ&aacute;nh gi&aacute; l&agrave; người c&oacute; đ&oacute;ng g&oacute;p rất lớn trong lĩnh vực gi&aacute;o dục ở Mỹ.</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-1-1603452655332206621286.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 2.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-1-1603452655332206621286.jpg\" title=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 2.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-2-1603452655334312105103.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 2.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-2-1603452655334312105103.jpg\" title=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 2.\" /></a></p>\r\n\r\n<p>Đệ nhất phu nh&acirc;n Mỹ (tr&aacute;i) v&agrave; b&agrave; Jill Biden khi c&ograve;n l&agrave; thiếu nữ đều sở hữu nhan sắc cuốn h&uacute;t, c&aacute; t&iacute;nh</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-3-1603452655335787991550.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 3.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-3-1603452655335787991550.jpg\" title=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 3.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-4-16034526553361714136201.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 3.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-4-16034526553361714136201.jpg\" title=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 3.\" /></a></p>\r\n\r\n<p>Họ đều l&agrave; những người phụ nữ t&agrave;i giỏi, c&oacute; sự nghiệp ri&ecirc;ng rực rỡ</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-5-1603452655337345347593.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 4.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-5-1603452655337345347593.jpg\" title=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 4.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-6-16034526553431207616919.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 4.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-6-16034526553431207616919.jpg\" title=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 4.\" /></a></p>\r\n\r\n<p>Cả hai được đ&aacute;nh gi&aacute; l&agrave; những tuyệt sắc giai nh&acirc;n thời bấy giờ</p>\r\n\r\n<p>Cả hai người phụ nữ đều thể hiện c&aacute; t&iacute;nh ri&ecirc;ng tr&ecirc;n con đường khẳng định h&igrave;nh ảnh của bản th&acirc;n. Họ được đ&aacute;nh gi&aacute; l&agrave; mẫu phụ nữ độc lập, bản lĩnh v&agrave; lu&ocirc;n biết c&aacute;ch thu h&uacute;t người đối diện. B&agrave; Jill Biden đ&atilde; c&oacute; một t&igrave;nh y&ecirc;u tuyệt đẹp với chồng, l&agrave; phụ t&aacute; đắc lực gi&uacute;p &ocirc;ng Joe Biden thăng hoa tr&ecirc;n ch&iacute;nh trường. D&ugrave; hỗ trợ chồng nhưng b&agrave; Jill Biden kh&ocirc;ng từ bỏ sự nghiệp gi&aacute;o dục.</p>\r\n\r\n<p>Trong khi đ&oacute;, Đệ nhất phu nh&acirc;n Mỹ l&agrave; người vợ thứ 3 của &ocirc;ng Donald Trump v&agrave; cũng l&agrave; người phụ nữ được &ocirc;ng hết mực y&ecirc;u thương, chiều chuộng. Kể từ khi trở th&agrave;nh Đệ nhất phu nh&acirc;n Mỹ, b&agrave; Melania đ&atilde; cố gắng hết m&igrave;nh hỗ trợ chồng v&agrave; ho&agrave;n th&agrave;nh nhiệm vụ tr&ecirc;n cương vị mới.</p>\r\n\r\n<p>C&oacute; thể thấy rằng, hai người phụ nữ đều l&agrave; những b&oacute;ng hồng biết c&aacute;ch tỏa hương thơm quyến rũ, tạo n&ecirc;n bản sắc v&agrave; dấu ấn của ri&ecirc;ng m&igrave;nh.</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-7-1603452655344507353758.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 5.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-7-1603452655344507353758.jpg\" title=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 5.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-8-1603452655345172388587.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 5.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-8-1603452655345172388587.jpg\" title=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 5.\" /></a></p>\r\n\r\n<p>B&agrave; Melania Trump v&agrave; b&agrave; Jill Biden đều to&aacute;t l&ecirc;n thần th&aacute;i xuất ch&uacute;ng, tự tin v&agrave; cuốn h&uacute;t</p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-10-1603452655349388642361.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 6.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-10-1603452655349388642361.jpg\" title=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 6.\" /></a></p>\r\n\r\n<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-9-16034526553471772207188.jpg\" rel=\"lightbox\" title=\"\"><img alt=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 6.\" src=\"https://kenh14cdn.com/thumb_w/660/2020/10/23/photo-9-16034526553471772207188.jpg\" title=\"Bên lề tranh cử Tổng thống Mỹ: Nhan sắc thời trẻ thuộc hàng &amp;quot;kẻ tám lạng, người nửa cân&amp;quot; khi so Đệ nhất phu nhân Mỹ với bà Jill Biden - Ảnh 6.\" /></a></p>\r\n\r\n<p>Cả hai người phụ nữ đều c&oacute; mối t&igrave;nh đẹp với hai người đ&agrave;n &ocirc;ng t&agrave;i giỏi</p>\r\n\r\n<p><em>Nguồn: Daily Mail, NY Post</em></p>\r\n\r\n<p><a href=\"javascript:void(0);\" rel=\"nofollow\" title=\"Theo Pháp luật và bạn đọc\">Theo&nbsp;Ph&aacute;p luật v&agrave; bạn đọc&nbsp;<em>Copy link</em></a></p>\r\n', 'ben-le-tranh-cu-tong-thong-my-nhan-sac-thoi-tre-thuoc-hang-ke-tam-lang-nguoi-nua-can-khi-so-de-nhat-phu-nhan-my-voi-ba-jill-biden', 'vi', null, null, '1603466780', '23', null, '1', '', '', '', '', null, '1', '0', '0');
INSERT INTO news VALUES ('18', 'Cá sấu bò lên nằm trên sân nhà dân ở Cà Mau', '<h2>Ph&aacute;t hiện con c&aacute; sấu khoảng 15kg nằm tr&ecirc;n s&acirc;n, nhiều người d&acirc;n đ&atilde; v&acirc;y bắt rồi b&aacute;n cho hộ nu&ocirc;i với gi&aacute; 300.000 đồng.</h2>\r\n', null, 'upload/img/news/casau.jpg', '<p><a href=\"https://kenh14cdn.com/2020/10/23/photo-1-16034568662881269282808.jpg\" target=\"_blank\" title=\"Hình minh họa\"><img alt=\"Cá sấu bò lên nằm trên sân nhà dân ở Cà Mau - Ảnh 1.\" id=\"img_05cdb110-152d-11eb-90fe-8d764074f447\" src=\"https://kenh14cdn.com/thumb_w/620/2020/10/23/photo-1-16034568662881269282808.jpg\" title=\"Cá sấu bò lên nằm trên sân nhà dân ở Cà Mau - Ảnh 1.\" /></a></p>\r\n\r\n<p>H&igrave;nh minh họa</p>\r\n\r\n<p>Chiều 23/10, UBND x&atilde; T&acirc;n Ph&uacute;, huyện Thới B&igrave;nh, tỉnh C&agrave; Mau cho biết người d&acirc;n vừa bắt được 1 con c&aacute; sấu nặng khoảng 15kg đang nằm trước s&acirc;n nh&agrave; một người d&acirc;n h&ocirc;m 22/10.</p>\r\n\r\n<p>Khi ph&aacute;t hiện con c&aacute; sấu tr&ecirc;n s&acirc;n nh&agrave; &ocirc;ng Nguyễn Văn Chuẩn, anh Phạm Văn H&ograve;a v&agrave; một số người ở địa phương đ&atilde; v&acirc;y bắt được. Sau đ&oacute;, con c&aacute; sấu được b&aacute;n cho một hộ nu&ocirc;i c&aacute; sấu tr&ecirc;n địa b&agrave;n với gi&aacute; 300.000 ng&agrave;n đồng.</p>\r\n\r\n<p>Qua ra so&aacute;t, UBND x&atilde; T&acirc;n Ph&uacute; chưa ph&aacute;t hiện hộ nu&ocirc;i c&aacute; sấu n&agrave;o tr&ecirc;n địa b&agrave;n bị mất vật nu&ocirc;i do sổng chuồng.</p>\r\n\r\n<p>Trước đ&oacute;, v&agrave;o ng&agrave;y 18/10, trong l&uacute;c đi c&acirc;n cua, thương l&aacute;i ph&aacute;t hiện một con c&aacute; sấu đang nổi đầu trước cống xổ vu&ocirc;ng của một hộ d&acirc;n tr&ecirc;n địa b&agrave;n x&atilde; T&acirc;n Tiến, huyện Đầm Dơi (C&agrave; Mau). Con c&aacute; sấu tr&ecirc;n đ&atilde; bị người d&acirc;n đập chết sau khi bắt được.</p>\r\n\r\n<p><a href=\"javascript:void(0);\" rel=\"nofollow\" title=\"Theo Nhịp sống Việt\">Theo&nbsp;Nhịp sống Việt&nbsp;<em>Copy link</em></a></p>\r\n', 'ca-sau-bo-len-nam-tren-san-nha-dan-o-ca-mau', 'vi', null, null, '1603614741', '19', '1', '1', '', '', '', '', null, '1', '1', '0');
